Future<User> fetchUserUpdateProfileDetails(
  String username,
  String name,
  String email,
  String phone,
  String image,
  String dob,
  String height,
  String weight,
  String hip,
  String waist,
  String bvi,
  String user_id,
) async {
  List<Map<String, dynamic>> list = [];

  list.add(
    {"key": "username", "value": "umer.leo", "type": "text"},
  );
  list.add(
    {"key": "name", "value": "umer bilal", "type": "text"},
  );

  list.add(
    {"key": "email", "value": "test2@gmail.com", "type": "text"},
  );

  list.add(
    {"key": "phone", "value": "12312312", "type": "text"},
  );

  list.add(
    {
      "key": "image",
      "value":
          "data:image/jpeg;base64,",
      "type": "text"
    },
  );

  list.add(
    {"key": "dob", "value": "1995-08-23", "type": "text"},
  );

  list.add(
    {"key": "height", "value": "5'7''", "type": "text"},
  );

  list.add(
    {"key": "weight", "value": "60", "type": "text"},
  );
  list.add(
    {"key": "hip", "value": "40", "type": "text"},
  );

  list.add(
    {"key": "waist", "value": "38", "type": "text"},
  );

  list.add(
    {"key": "bvi", "value": "12", "type": "text"},
  );

  list.add({"key": "user_id", "value": "5", "type": "text"});


  Map<String, dynamic> headers = {
    'Accept': 'application/json',
    'X-Requested-With': 'XMLHttpRequest',
    'Content-Type': 'application/json',
  };

  final response = await http.post(BASE_URL + "/user/get/coaches",
      headers: headers, body: jsonEncode(list));

  if (response.statusCode == 200) {
    Map<String, dynamic> responseBody = jsonDecode(response.body);
    return User.fromJson(responseBody["user"]);
  } else {
    throw Exception(jsonDecode(response.body)['message']);
  }
}
